export default {
    addSelected ({commit}, newSelect) {
        commit('addSelected', newSelect)
    },
    clearSelected ({commit}) {
        commit('clearSelected')
    },
    doneEdit ({commit}, item) {
        commit('doneEdit', item)
    }
}
